import React, { useEffect, useState } from "react";
import HeaderBar from "@components/header"
import { useHistory } from "react-router-dom";
import { queryActivityTypes } from "./request"
import "./style.scss"
const Password = () => {
  const [check, setCheck] = useState(1)
  const [registerInfo, setRegisterInfo] = useState<any>({})
  const { goBack, push } = useHistory();
  useEffect(() => {

  }, [])
  const change = (e: any, key: string) => {
    setRegisterInfo({ ...registerInfo, [key]: e.target.value })
  }
  return (
    <div className="password-wrap">
      <HeaderBar goback={goBack} title={"修改密码"} />
      <div className="main">
        <p className="inputs">
          <i className="icons pw"></i>
          <span>原密码</span>
          <input type="password" onChange={(e) => { change(e, "pwd") }} placeholder="请输入原密码" />
        </p>
        <p className="inputs">
          <i className="icons pw"></i>
          <span>新密码</span>
          <input type="password" onChange={(e) => { change(e, "pwd") }} placeholder="6-18位大小写字母+数字组合" />
        </p>
        <p className="inputs">
          <i className="icons pw"></i>
          <span>确认密码</span>
          <input type="password" onChange={(e) => { change(e, "entryPwd") }} placeholder="确认密码" />
        </p>
      </div>
      <div className="pay-on-btn" onClick={() => push("consignment")}>确认</div>
    </div>
  )
}
export default Password;
